    "swfsc-mmtd-population-of-delphinus-stocks-pods-1993",nt"isopen": false,nt"url":
    null,nt"notes": "The Southwest Fisheries Science Center (SWFSC) has conducted
    a variety of marine mammal surveys in the eastern tropical Pacific (ETP) and other
    areas of the Pacific Ocean. The purpose of these surveys has been to estimate cetacean
    population sizes and to monitor the impact of incidental kill due to commercial
    fisheries, particularly the tropical purse-seine fishery for yellowfin and skipjack
    tuna.  The northern stock of common dolphin, Delphinus delphis, is taken in the
    purse-seine tuna fishery (Hall and Lennert 1994). The index of relative abundance
    for this stock computed from sightings on tuna vessels has declined substantially
    in the last decade (Anganuzzi and Buckland 1994). However, because tuna vessels
    cover only the southern portion of the stocku00e2u0080u0099s range, the declines
    in the index may be due to a northward shift in distribution, rather than an actual
    decline in abundance. There has been an increase in abundance of tropical delphinids
    and a decrease in abundance of temperate delphinids during this period in California
    waters, accompanied by a general warming trend in ocean temperature (Barlow, 1993).
    Previous research vessel surveys have covered either northern (Hill and Barlow 1992)
    or southern (Wade and Gerrodette 1993) parts of the range of the northern common
    dolphin, but neither of these surveys have covered the middle portion of the range
    off the coast of northern Baja California. The 1993 survey was designed to produce
    the first range-wide estimates of abundance for the northern common dolphin and
    its recently described congener, Delphinus capensis (Heyning and Perrin, 1994) .
    The 1993 survey was conducted by the NOAA Ships McArthur and David Starr Jordan.",nt"license_title":
